import React from "react";
import "./StartScreen.css";
import HomePage from "./HomePage";
function StartScreen() {
  return (
    <div className="start_banner">
      <div className="nav_contents">
        <img
          className="nav_logo"
          src="http://assets.stickpng.com/images/580b57fcd9996e24bc43c529.png"
          alt=""
        ></img>
        <button
          className="start_nav_button"
          onClick={(event) => (window.location.href = "/HomePage")}
        >
          Sign In
        </button>
      </div>
      <div className="whole_cont">
        <div className="start_contents">
          <p>
            <h1 className="start_h1">Unlimited movies,TV shows and more.</h1>
            <h2>Watch anywhere. Cancel anytime.</h2>{" "}
            <h3>
              Ready to watch? Enter your email to create or restart your
              membership.
            </h3>
          </p>
        </div>
      </div>
    </div>
  );
}

export default StartScreen;
